import React from "react";

function FilterByTicketNumber({ data }) {
  return (
    <div>
      {data === null && console.log("no data ")}
      {data !== null && <h3>{console.log(data[0].CheckInDate)}</h3>}
    </div>
  );
}

export default FilterByTicketNumber;
